    "2015-09-26T21:31:09.709174",nt"name": "temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation45797",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0115320 includes chemical,
    discrete sample, physical and profile data collected from BOSEI MARU NO. 2 in the
    North Pacific Ocean from 1994-01-15 to 1994-02-04 and retrieved during cruise PACIFICA_49EW19940115
    and WOCE P02C. These data include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE
    + NITRITE CONTENT (CONCENTRATION), PHOSPHATE, Potential temperature (theta), SALINITY,
    SILICATE and WATER TEMPERATURE. The instruments used to collect these data include
    CTD and bottle. These data were collected by Masao Fukasawa of Japan Agency for
    Marine-Earth Science and Technology (Jamstec) as part of the PACIFICA_49EW19940115
    data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
    project for the data synthesis of ocean interior carbon and its related parameters
    in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
    of Carbon and Climate (S-CC) supported the project.",nt"license_title": null,nt"extras":
